import React from 'react'
export default function JobsList(props){
  return(
  <div className="Jobs">
      <h1 className="role">{props.designation}</h1>
      <div className="company"><span className="grey">{props.company}</span> id:{props.id} {props.loction} Minimum Experience:{props.min_experience}</div>  
  </div>
  )
}
